use super::{find_char_index::FindCharIndex, to_vec::ToVec};

#[derive(Clone, Debug)]
pub struct DayYiJi {
  elems: Option<Vec<DayYiJiElem>>,
}

#[derive(Clone, Debug)]
pub struct DayYiJiElem {
  pub day_hex: String,
  pub month_hexs: Vec<String>,
  pub yi_hexs: Vec<String>,
  pub ji_hexs: Vec<String>,
}

impl Default for DayYiJi {
  fn default() -> Self {
    Self { elems: None }
  }
}

impl DayYiJi {
  fn setup(&mut self) -> Self {
    // consists of "[(day=[month]:yi,ji)]"
    let __compacted = COMPACTED.to_string();
    let __compacted_char_len = __compacted.chars().count();
    let mut day_delim = __compacted.find_char_index("=");
    let mut elems = vec![];
    while day_delim.is_some() {
      let start = day_delim.unwrap() - 2;
      let end = day_delim.unwrap();
      let day_hex = __compacted.slice_by_char_idx(start, end);

      let start = end + 1;
      let end = __compacted.find_char_index_offset(start, ":").unwrap();
      let month_hexs =
        __compacted.slice_by_char_idx(start, end).to_vec_hex_str();

      let start = end + 1;
      let end = __compacted.find_char_index_offset(start, ",").unwrap();
      let yi_hexs =
        __compacted.slice_by_char_idx(start, end).to_vec_hex_str();

      let start = end + 1;
      let end = __compacted
        .find_char_index_offset(start, "=")
        .map_or(__compacted_char_len, |v| v - 2);
      let ji_hexs =
        __compacted.slice_by_char_idx(start, end).to_vec_hex_str();

      elems.push(DayYiJiElem {
        day_hex,
        month_hexs,
        yi_hexs,
        ji_hexs,
      });

      day_delim = match end == __compacted_char_len {
        true => None,
        _ => Some(end + 2),
      };
    }

    self.elems = Some(elems);
    self.clone()
  }

  pub fn collect_yi_hexs(
    &mut self,
    day_hex: &str,
    month_hex: &str,
  ) -> Vec<String> {
    if self.elems.is_none() {
      self.setup();
    };

    let found = self
      .elems
      .as_ref()
      .unwrap()
      .iter()
      .filter(|elem| elem.day_hex == day_hex)
      .filter(|elem| {
        elem
          .month_hexs
          .iter()
          .find(|m_hex| month_hex == m_hex.as_str())
          .is_some()
      })
      .collect::<Vec<_>>();

    let found = found
      .iter()
      .map(|f| f.yi_hexs.clone())
      .flatten()
      .collect::<Vec<_>>();

    found
  }

  pub fn collect_ji_hexs(
    &mut self,
    day_hex: &str,
    month_hex: &str,
  ) -> Vec<String> {
    if self.elems.is_none() {
      self.setup();
    };

    let found = self
      .elems
      .as_ref()
      .unwrap()
      .iter()
      .filter(|elem| elem.day_hex == day_hex)
      .filter(|elem| {
        elem
          .month_hexs
          .iter()
          .find(|m_hex| month_hex == m_hex.as_str())
          .is_some()
      })
      .collect::<Vec<_>>();

    let found = found
      .iter()
      .map(|f| f.ji_hexs.clone())
      .flatten()
      .collect::<Vec<_>>();

    found
  }
}

